(1, '2018/2019', 'STMIK PRINGSEWU LAMPUNG', 'SEKOLAH TINGGI MANAJEMEN INOFORMATIKA DAN KOMPUTER', 'Jl. Wismarini No 09 Pringsewu Lampung', '<ol>\r\n	<li>Mendaftar/login Sebagai Angota Perpustakaan</li>\r\n	<li>Mencetak Bukti Pemijaman Buku Online .</li>\r\n	<li>Peminjaman maksimal 2 buku.</li>\r\n	<li>Hasil Cetak Peminjaman Buku Online harus dibawa pada saat peminjaman buku.</li>\r\n	<li>Menjaga dan memelihara buku yang dipinjam.</li>\r\n	<li>Jika Peminjam Telat Dalam mengembalikan Buku maka akan kena denda sebeser Rp.2.000 /hari.</li>\r\n	<li>Peminjaman Buku Maksimal 7 hari.</li>\r\n	<li>Mengembalikan buku tepat pada waktunya.</li>\r\n	<li>Buku rusak atau hilang wajib diganti dengan buku yang sama atau diganti dengan buku yang subyek, jumlah dan tahun terbit sama.</li>\r\n</ol>\r\n', 'mardybest@gmail.com');
